    def endStep(self):
        print('YOU LOST GOOD TRY')
        # print('YOURE SCORE WAS ' + str(self.score))

    def take_turn(self, direction):
        old_board = list(copy.deepcopy(self.board))
        #self.print_board()
        if (self.finished):
            print('game over please reset')
        if (direction == 0):
            #print('move left')
            self.move_left()
        elif (direction == 1):
            #print('move right')
            self.move_right()
        elif (direction == 2):
            #print('move up')
            self.move_up()
        elif (direction == 3):
            #print('move down')
            self.move_down()
        loss_check = self.check_for_loss()
        #print(self.score)
        if (old_board == self.board):
            if (print == True):
                self.print_board()
            return False
        else:
            self.insertRandomNew()
            if (print == True):
                if (old_board == self.board):
                    self.print_board()
            return True


